def get_rectangles(x_data, y_data, w1, w2):
    x_lo, x_q1, x_median, x_q3, x_hi = x_data[0], x_data[1], x_data[2], x_data[3], x_data[4]
    y_lo, y_q1, y_median, y_q3, y_hi = y_data[0], y_data[1], y_data[2], y_data[3], y_data[4]

    rect = patches.Rectangle((x_lo, y_lo), x_hi-x_lo, y_hi-y_lo, linewidth=w2, edgecolor='k', facecolor='none')
    rect2 = patches.Rectangle((x_q1, y_q1), x_q3-x_q1, y_q3-y_q1, linewidth=w1, edgecolor='r', facecolor='none')

    return rect, rect2, [y_q1, x_median, y_q3], [x_q1, y_median, x_q3]


