admin_encodable_data_plus[['Main_NMR_Mapsheet']].head(6)


# In[ ]:


admin_encodable_data_plus[['pt1','pt2']] = admin_encodable_data_plus['Main_NMR_Mapsheet'].str.split(" ", 1, expand=True)
admin_encodable_data_plus[['pt2','pt3']] = admin_encodable_data_plus['pt2'].str.split(" ", 1, expand=True)
admin_encodable_data_plus[['pt3','Site_no']] = admin_encodable_data_plus['pt3'].str.split(" ", 1, expand=True)
admin_encodable_data_plus['OS_Mapsheet'] = admin_encodable_data_plus['pt1'] + admin_encodable_data_plus['pt2'] + admin_encodable_data_plus['pt3']
