# <a name="den_trans"></a>
# #### Density Data Transformed

# In [Density Data Plotted](#loc_den_hist) it was noted that the distribution of the density values was crushed to the left of the histogram and relatively flat across the remainder of the chart. Ideally, we want the data to be distributed as close as is possible to a normal curve, with most of the data toward the centre of the histogram.

# <a title="M. W. Toews, CC BY 2.5 &lt;https://creativecommons.org/licenses/by/2.5&gt;, via Wikimedia Commons" href="https://commons.wikimedia.org/wiki/File:Standard_deviation_diagram.svg"><img width="500" alt="Standard deviation diagram" src="https://upload.wikimedia.org/wikipedia/commons/thumb/8/8c/Standard_deviation_diagram.svg/640px-Standard_deviation_diagram.svg.png"></a>

# *A Normal Curve*<br><a href="https://commons.wikimedia.org/wiki/File:Standard_deviation_diagram.svg">*M. W. Toews*</a>, <a href="https://creativecommons.org/licenses/by/2.5">*CC BY 2.5*</a>, *via Wikimedia Commons*

# The density values are transformed, to create a new feature, using the Boxcox power transformation. The Boxcox transformation searches across a range of transform formula and returns the distribution closest to a normal curve. This does not mean the resulting distribution is a normal curve, it is simply the closest possible from the options tested.

# Ref: https://docs.scipy.org/doc/scipy/reference/generated/scipy.stats.boxcox.html

# In[ ]:


transformed_location_numeric_data_short = location_numeric_data_short.copy()
transformed_location_numeric_data_short['Density_trans'], best_lambda = stats.boxcox(transformed_location_numeric_data_short['Density'])
transformed_location_numeric_data_short.head()


# The resulting histogram is still loaded toward one end - this time the right - but the remainder of the data is spread across the centre of the histogram and is likely to lead to a more revealing density map.

# In[ ]:


plot_histogram(transformed_location_numeric_data_short['Density_trans'], 'Density Transformed', 'Density Transformed')


# In[ ]:


best_lambda


